fields.description:
Часы б/у. Есть небольшие царапины, так как активно использовались.
Пульс и активность считают отлично. В комплекте коробка и документация.
В целом устройством довольна, продаю потому что подарили новые.

Основные функции (описание с сайта):
Измерение частоты сердечных сокращений, расчет количества сожженных калорий и процент сожженного жира;
Отслеживание показателя среднего потребления кислорода;
Разделение на пульсовые зоны и определение времени тренировки в каждой из пульсовых зон;
Отчет по проделанной работе и рекомендации по дальнейшим тренировкам.
Отчет по времени нагрузки, активности, количеству шагов, расстоянию за день и потраченным калориям;
Установка цели на день, информирование о степени ее достижения и влияния на ваше здоровье;
Анализ времени и качества сна.
Отличительной особенностью Polar A300 является длительная работа без подзарядки – до 28 дней.
